import React from 'react';
import Card from './Card';
import img1 from '../img/CHICKEN PAKORA.jpg';



const Services = (()=> {
    return(
        <>
        <div className="my-5">
        <h2 className="text-center">Our Services</h2>
        </div>
        <section>
            <div className="container-fluid mb-5">
                <div className="row">
                    <div className="col-10 mx-auto">
                     <div className="row">
                         <Card
                            title=""
                            imgscr={img1}
                            pera="Some quick example text to build on the card title and make up the bulk of the card's content"
                            link="/services"
                         />

                     </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    )
});

export default Services;
